  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains a unified GeoTiff
  with 50x50 meter cell size representing the bathymetry Bight, derived from data
  collected in 2001 by the of the Charleston Bump off of the South Atlantic NOAA Ship
  Whiting. NOAA's NOS/NCCOS/CCMA Biogeography Branch, in collaboration with the South
  Carolina Department of Natural Resources, as well as the NOAA Ship Whiting , and
  private sector partners, acquired multibeam bathymetry data off the Charleston Bump
  from 06/18/2001 to 06/21/2001. Data was acquired with a hull-mounted Kongsberg Simrad
  Single Beam Echosounder. It was processed by interpolating a bathymetrical surface
  from feature class points using the spatial analyst natural neighbor tool with 9
  neighbor cell radius. The bathymetry raster surface was exported as a 50m GeoTiff
  and the slope was derived by using the ESRI ArcMap10 Spatial Analyst Slope tool..\",\n\t\"owner_org\":
